import React from "react";
import "./Footer.css";
import * as fiIcons from "react-icons/fi";
import * as faIcons from "react-icons/fa";
const Footer = () => {
  return (
    <footer className="footer-container">
      <div className="footer-links">
        <fiIcons.FiGithub />
        <faIcons.FaLinkedinIn />
        <faIcons.FaInstagram />
      </div>
    </footer>
  );
};

export default Footer;
